import axios from "axios";

export const fetchNews = async () => {
  try {
    const response = await axios.get(
      "https://api.nytimes.com/svc/topstories/v2/business.json?api-key=pKDzZjnahcEPMXQlVkEvGT5zVDXXdqjc"
    ).then((response) => response.data);
    if (response.status === 200 && response.data.results) {
      let articles = response.data.results.filter(
        (news) => news.item_type === "Article"
      );
      return articles;
    }
  } catch (error) {
    console.error("Error fetching daily stock data:", error);
  }
};
